export const Transactions = (props) => {
  let i = 0;

  return (
    <div>
      <h1>List of Txs:</h1>
      {props.txs.map((el, i) => {
        return <ul key={i}>{el}</ul>;
      })}
    </div>
  );
};

export default Transactions;
